import React from 'react';
import App from '../App'
import HomePage from '../pages/HomePage'
import { Outlet, Navigate, useRoutes } from 'react-router-dom';

export default function Routes(){
    const publicRoutes = [
        {
            element: <App />,
            path: '/',
            children: [
                { element: <HomePage />, path: '/home' },
            ]
        }
    ]

    routes = useRotes(publicRoutes);
    return routes
}
